import ReactDOM from 'react-dom';

const App = () => {
    const [posts, setPosts] = useState([]);

    useEffect(() => {
        const fetchPosts = async () => {
            const resp = await fetch('https://strangers-things.herokuapp.com/api/2105-SJS-RM-WEB-PT/posts');
            const data = await resp.json();
            setPosts(data);
        }
        fetchPosts();
    }, [])

  return <div>
    Hello World
  </div>
}

